import React from 'react';
import {Link} from 'react-router-dom';
class Homepage extends React.Component{
    render(){
        return(
            <div>
                <Link to="/signup"><button>Sign up</button></Link>
                <Link to="/login"><button>Log in</button></Link>
            </div>
        )
    }
}
export default Homepage;
